function s.oop41(tablet,str)
	local ct=0
	for key,value in pairs(tablet) do
		if string.sub(key,1,2)=="__" then
			local kstr=str..key
			Debug.Message(kstr)
		elseif type(value)=="table" then
			local kstr=str..key.."."
			local kct=s.oop41(value,kstr)
			ct=ct+kct
		elseif type(value)=="function" then
			local kstr=str..key
			ct=ct+1
			Debug.Message(kstr)
			if kstr~="Debug.Message" then
				local oldf=tablet[key]
				tablet[key]=function(...)
					if s[2] and not s[2][kstr] then
						if not s[4] then
							s[4]={}
						end
						table.insert(s[4],kstr)
						s[5]=s[5]+1
						if s[6][s[5]]~=nil then
							return s[6][s[5]]
						end
						return s[3]
					end
					return oldf(...)
				end
			end
		end
	end
	return ct
end
function string:split(delimiter)
	local result = {}
	local from = 1
	local delim_from,delim_to = string.find(self,delimiter,from)
	while delim_from do
		table.insert(result,string.sub(self,from,delim_from-1))
		from = delim_to + 1
		delim_from,delim_to = string.find(self,delimiter,from )
	end
	table.insert(result,string.sub(self,from))
	return result
end
